import React from "react";

function List(props) {
return <div><ul className="list-group">

  {props.groceries.map(function(element,index){
    return ( 
    <li className="list-group-item">
    {element.name}
    </li>
  )}
  )}
    </ul>
    </div>
}


export default List;
